import React from 'react';
import { List, Header } from "semantic-ui-react"


export const Garments = ({ garments }) => {
	return (
		<List>
			{garments.map(garment => {
				return(
					<List.Item key={garment.gtin} key={garment.colorName} key={garment.colorFrontImage}> 
						<Header>{garment.gtin} {garment.colorName} <img src='https://www.ssactivewear.com/{garment.colorFrontImage}'/> </Header>
					</List.Item>
					)
			})}

		</List>

	)
}
